<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta name="mobile-web-app-capable" content="yes">
    <title>AI For Social Impact : AI Youth Directors</title>
    <!-- 
    MOBILE VIEWING INSTRUCTIONS:
    Mobile browsers often block local file access. To view on phone:
    
    Option 1 - Use a local server:
    1. Keep this file in the public folder
    2. Run: npm run dev (or python -m http.server 8000)
    3. Access via: http://localhost:3000/index-standalone.html (or http://your-ip:8000/index-standalone.html)
    
    Option 2 - Use a file sharing service:
    Upload the HTML file and images to Google Drive, Dropbox, or similar
    and open the shared link on your phone.
    
    Option 3 - Use a mobile file manager app:
    Some apps like "HTML Viewer" can open local HTML files with images.
    -->
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'Roboto', 'Oxygen', 'Ubuntu', 'Cantarell', 'Fira Sans', 'Droid Sans', 'Helvetica Neue', sans-serif;
            min-height: 100vh;
            background: linear-gradient(to bottom right, #dcfce7, #cffafe, #dbeafe);
            position: relative;
            overflow: hidden;
        }

        /* Earth emojis background */
        .earth-bg {
            position: fixed;
            inset: 0;
            z-index: -1;
            pointer-events: none;
            opacity: 0.2;
        }

        .earth-emoji {
            position: absolute;
            font-size: 3rem;
            animation: bounce 4s infinite;
        }

        @keyframes bounce {
            0%, 100% { transform: translateY(0px); }
            50% { transform: translateY(-20px); }
        }


        /* Main content */
        .container {
            min-height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 2rem;
            position: relative;
            z-index: 10;
        }

        .content {
            text-align: center;
            max-width: 42rem;
        }

        /* Logos */
        .logos {
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            gap: 0.75rem;
            margin-bottom: 1.5rem;
            width: 100%;
        }

        .logo {
            height: 3rem;
            max-width: 180px;
            width: auto;
            object-fit: contain;
            display: block;
            margin: 0 auto;
            -webkit-user-select: none;
            user-select: none;
            -webkit-touch-callout: none;
        }

        @media (min-width: 768px) {
            .logo {
                height: 3.5rem;
                max-width: 200px;
            }
        }

        @media (min-width: 1024px) {
            .logo {
                height: 4rem;
                max-width: 200px;
            }
        }

        /* Mobile-specific logo fixes */
        @media (max-width: 640px) {
            .logo {
                height: 2.5rem;
                max-width: 150px;
            }
        }

        /* Title */
        .title {
            font-size: 3rem;
            font-weight: 700;
            margin-bottom: 1rem;
            line-height: 1.2;
        }

        @media (min-width: 768px) {
            .title {
                font-size: 3.75rem;
            }
        }

        .title-shine {
            position: relative;
            display: inline-block;
            overflow: hidden;
            color: #eab308;
        }

        .title-shine::after {
            content: '';
            position: absolute;
            top: 0;
            left: -100%;
            width: 50%;
            height: 100%;
            background: linear-gradient(90deg, transparent 0%, rgba(255,255,255,0.8) 50%, transparent 100%);
            transform: skewX(-20deg);
            animation: shine 3s infinite;
            animation-delay: 2s;
        }

        @keyframes shine {
            0% { left: -100%; }
            100% { left: 300%; }
        }

        /* Subtitle */
        .subtitle {
            font-size: 1.125rem;
            color: #4b5563;
            margin-bottom: 0.5rem;
        }

        @media (min-width: 768px) {
            .subtitle {
                font-size: 1.25rem;
            }
        }

        .description {
            font-size: 1.25rem;
            color: #374151;
            margin-bottom: 3rem;
        }

        @media (min-width: 768px) {
            .description {
                font-size: 1.5rem;
            }
        }

        /* Buttons */
        .buttons {
            display: flex;
            flex-direction: column;
            gap: 1rem;
            align-items: center;
        }

        .button-row {
            display: flex;
            flex-direction: column;
            gap: 1rem;
        }

        @media (min-width: 640px) {
            .buttons {
                flex-direction: row;
            }
            .button-row {
                flex-direction: row;
            }
        }

        .btn {
            padding: 1rem 3rem;
            font-size: 1.5rem;
            font-weight: 700;
            border-radius: 9999px;
            border: none;
            cursor: pointer;
            transition: all 0.3s;
            text-decoration: none;
            display: inline-block;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .btn:hover {
            transform: scale(1.05);
            box-shadow: 0 10px 15px rgba(0, 0, 0, 0.2);
        }

        .btn:active {
            transform: scale(0.95);
        }

        .btn-primary {
            background: linear-gradient(to right, #9333ea, #db2777);
            color: white;
        }

        .btn-secondary-dark {
            background: white;
            border: 2px solid #1e3a8a;
            color: #1e3a8a;
        }

        .btn-secondary-light {
            background: white;
            border: 2px solid #60a5fa;
            color: #2563eb;
        }
    </style>
</head>
